userDefinedLinkHintCss:
div > .vimiumHintMarker {
    /* linkhint boxes */
    background: -webkit-gradient(linear, left top, left bottom, color-stop(0%,#ffa54d),
    color-stop(100%,#ff8812));
    border: 1px solid #ffc082;
}

li.vomnibarSelected {

     color: white !important;
     border-top: 0px !important;
     border-bottom: 3px solid white !important;


}

div > .vimiumHintMarker span {
    /* linkhint text */
    color: black;
    font-weight: bold;
    font-size: 12px;
}

input#vomnibarInput.vimiumReset {
    color: #FFF !important;
    background-color: #111 !important;
}

input#vomnibarInput {
    color: #FFF !important;
    background-color: #111 !important;
}

#vomnibar {
    border-color: black;
    background-color: black;
}

#vomnibar .vomnibarSearchArea {
    background-color: #222;
    border-bottom: #3f3f3f;
}

#vomnibar input {
    border-color: #393939;
}

#vomnibar ul {
    background-color: #222;
    margin: 0;
}

#vomnibar li {
    border-bottom: white;
}

#vomnibar li .vomnibarUrl {
    color: #5287e3;
}

#vomnibar li .vomnibarMatch {
    color: white;
}

#vomnibar li.vomnibarSelected {


   background-color: black;
}

#vomnibar li em .vomnibarMatch, #vomnibar li .vomnibarTitle .vomnibarMatch {
    color: white;
}

#vomnibar li em, #vomnibar li .vomnibarTitle {
    color: #ddd;
}

.vomnibarBottomHalf {
   background-color: white;


}

div#vimiumHelpDialog {
    background-color: #222;
}

div#vimiumHelpDialog td.vimiumHelpDescription {
    color: white
}

div#vimiumHelpDialog td.vimiumHelpSectionTitle {
    color: #777;
}

a:link.vimiumHelDialogLink, a:visited.vimiumHelDialogLink, a:hover.vimiumHelDialogLink, a:active.vimiumHelDialogLink, a#toggleAdvancedCommands {
    color: #5287e3;
}

span#vimiumTitle.vimiumReset {
    color: #666;
}

span#vimiumReset {
    color: #5287e3;
}
